# https://discuss.leetcode.com/topic/11632/a-python-solution-85ms-o-n/9
class Solution(object):
    def lengthOfLongestSubstring(self, s):
        maxLen = 0
        ind = 0
        usedChar = {}
        
        for i in range(len(s)):
            if s[i] in usedChar and ind <= usedChar[s[i]]:
                ind = usedChar[s[i]] + 1
            else:
                maxLen = max(maxLen, i - ind + 1)
            usedChar[s[i]] = i
        return maxLen
            

